    const [username, setUsername] = useState("")
    const [password, setPassword] = useState("")

    return (<div className="login-form-wrapper">
        <div className="app-logo">
            <img src={logo} alt="app logo" />
        </div>
        <h1>Sign In</h1>
        <div className="form-field">
            <TextInputV2 type="text" className="username" placeholder="username" value={username} />
        </div>
        <div className="form-field">
        <TextInputV2 type="password" className="password" placeholder="password" value={password} />
        </div>
        <div className="form-field">
            <button type="submit" classname="app-button" > LOGIN </button>
        </div>
        <p className="forgot-password">Forget Password? <b><a href="">click here</a></b></p>
    </div>)
}

export default LoginForm;
